keyFieldValue = subFieldValue;","    //             subFieldValue = _temporaryValue;","    //         }","","    //         if (keyFieldValue.match(REGEX.ISPERCENT)) {","    //             // This is a percentage based change. Copy it verbatim.","    //             subFieldValue = keyFieldValue;","","    //             // Set the width to the calculated pixel width.","    //             rawPercentage = parseInt(keyFieldValue, 10);","    //             rawSize = this._rawImageDimensions.width / 100 * rawPercentage;","","    //             // And apply the width/height to the container.","    //             imagePreview.setStyle('width', rawSize);","    //             rawSize = this._rawImageDimensions.height / 100 * rawPercentage;","    //             imagePreview.setStyle('height', rawSize);","    //         } else {","    //             // Calculate the scaled subFieldValue from the keyFieldValue.","    //             subFieldValue = Math.round((keyFieldValue / this._rawImageDimensions[keyFieldType]) *","    //                     this._rawImageDimensions[subFieldType]);","","    //             if (forceHeight) {","    //                 imagePreview.setStyles({","    //                     'width': subFieldValue,","    //                     'height': keyFieldValue","    //                 });","    //             } else {","    //                 imagePreview.setStyles({","    //                     'width': keyFieldValue,","    //                     'height': subFieldValue","    //                 });","    //             }","    //         }","","    //         // Update the subField's value within the form to reflect the changes.","    //         subField.set('value', subFieldValue);","    //     }","    // },","","    /**","     * Update the dialogue after an image was selected in the File Picker.","     *","     * @method _filepickerCallback","     * @param {object} params The parameters provided by the filepicker","     * containing information about the image.","     * @private","     */","    _filepickerCallback: function(params) {","        if (params.url !== '') {","            var input = this._form.one('.' + CSS.INPUTURL);","            input.set('value', params.url);","","            // Auto set the width and height.","            // this._form.one('.' + CSS.INPUTWIDTH).set('value', '');","            // this._form.one('.' + CSS.INPUTHEIGHT).set('value', '');","","            // Load the preview image.","            this._loadPreviewImage(params.url);","        }","    },","","    /**","     * Returns the callback for the file picker to call after a file has been selected.","     *","     * @method _getFilepickerCallback","     * @param  {Y.Node} element The element which triggered the callback (atto form)","     * @return {Function} The function to be used as a callback when the file picker returns the file","     * @private","     */","    _getFilepickerCallback: function(element) {","        console.log('element',element);","        return function(params) {","            if (params.url !== '') {","                var input = element.one('.' + CSS.INPUTURL);","                input.set('value', params.url);","","                // element.one('.' + CSS.INPUTWIDTH).set('value', '');","                // element.one('.' + CSS.INPUTHEIGHT).set('value', '');","","                // Load the preview image.","                var image = new Image();","","                image.onerror = function() {","                    var preview = element.one('.' + CSS.IMAGEPREVIEW);","                    preview.setStyles({","                        'display': 'none'","                    });","                };","","                image.onload = function() {","                    var input;","","                    input = element.one('.' + CSS.IMAGEPREVIEW);","                    input.setAttribute('src', this.src);","                    input.setStyles({","                        'display': 'inline'","                    });","                };","","                image.src = params.url;","            }","        };","    },","","    /**","     * Applies properties of an existing image to the image dialogue for editing.","     *","     * @method _applyImageProperties","     * @param {Node} form","     * @private","     */","    _applyImageProperties: function(form) {","        var properties = this._getSelectedImageProperties(),","            img = form.one('.' + CSS.IMAGEPREVIEW);","","        if (properties === false) {","            img.setStyle('display', 'none');","            // Set the default alignment.","            ALIGNMENTS.some(function(alignment) {","                if (alignment.isDefault) {","                    form.one('.' + CSS.INPUTALIGNMENT).set('value', alignment.value);","                    return true;","                }","","                return false;","            }, this);","","            return;","        }","","        if (properties.align) {","            form.one('.' + CSS.INPUTALIGNMENT).set('value', properties.align);","        }","        if (properties.customstyle) {","            form.one('.' + CSS.INPUTCUSTOMSTYLE).set('value', properties.customstyle);","        }","        // if (properties.width) {","        //     form.one('.' + CSS.INPUTWIDTH).set('value', properties.width);","        // }","        // if (properties.height) {","        //     form.one('.' + CSS.INPUTHEIGHT).set('value', properties.height);","        // }","        if (properties.alt) {","            form.one('.' + CSS.INPUTALT).set('value', properties.alt);","        }","        if (properties.src) {","            form.one('.' + CSS.INPUTURL).set('value', properties.src);","            this._loadPreviewImage(properties.src);","        }","        if (properties.presentation) {","            form.one('.' + CSS.IMAGEPRESENTATION).set('checked', 'checked');","        }","","        // Update the image preview based on the form properties.","        // this._autoAdjustSize();","    },","","    /**","     * Gets the properties of the currently selected image.","     *","     * The first image only if multiple images are selected.","     *","     * @method _getSelectedImageProperties","     * @return {object}","     * @private","     */","    _getSelectedImageProperties: function() {","        var properties = {","                src: null,","                alt: null,","                //width: null,","                //height: null,","                align: '',","                presentation: false","            },","","            // Get the current selection.","            images = this.get('host').getSelectedNodes(),","            //width,","            //height,","            style,","            image;","","        if (images) {","            images = images.filter('img');","        }","","        if (images && images.size()) {","            image = this._removeLegacyAlignment(images.item(0));","            this._selectedImage = image;","","            style = image.getAttribute('style');","            properties.customstyle = style;","","            // width = image.getAttribute('width');","            // if (!width.match(REGEX.ISPERCENT)) {","            //     width = parseInt(width, 10);","            // }","            // height = image.getAttribute('height');","            // if (!height.match(REGEX.ISPERCENT)) {","            //     height = parseInt(height, 10);","            // }","","            // if (width !== 0) {","            //     properties.width = width;","            // }","            // if (height !== 0) {","            //     properties.height = height;","            // }","            this._getAlignmentPropeties(image, properties);","            properties.src = image.getAttribute('src');","            properties.alt = image.getAttribute('alt') || '';","            properties.presentation = (image.get('role') === 'presentation');","            return properties;","        }","","        // No image selected - clean up.","        this._selectedImage = null;","        return false;","    },","","    /**","     * Sets the alignment of a properties object.","     *","     * @method _getAlignmentPropeties","     * @param {Node} image The image that the alignment properties should be found for","     * @param {Object} properties The properties object that is created in _getSelectedImageProperties()","     * @private","     */","    _getAlignmentPropeties: function(image, properties) {","        var complete = false,","            defaultAlignment;","","        // Check for an alignment value.","        complete = ALIGNMENTS.some(function(alignment) {","            var classname = this._getAlignmentClass(alignment.value);","            if (image.hasClass(classname)) {","                properties.align = alignment.value;","","                return true;","            }","","            if (alignment.isDefault) {","                defaultAlignment = alignment.value;","            }","","            return false;","        }, this);","","        if (!complete && defaultAlignment) {","            properties.align = defaultAlignment;","        }","    },","","    /**","     * Update the form when the URL was changed. This includes updating the","     * height, width, and image preview.","     *","     * @method _urlChanged","     * @private","     */","    _urlChanged: function() {","        var input = this._form.one('.' + CSS.INPUTURL);","","        if (input.get('value') !== '') {","            // Load the preview image.","            this._loadPreviewImage(input.get('value'));","        }","    },","","    /**","     * Update the image in the contenteditable.","     *","     * @method _setImage","     * @param {EventFacade} e","     * @private","     */","    _setImage: function(e) {","        var form = this._form,","            url = form.one('.' + CSS.INPUTURL).get('value'),","            alt = form.one('.' + CSS.INPUTALT).get('value'),","            //width = form.one('.' + CSS.INPUTWIDTH).get('value'),","            //height = form.one('.' + CSS.INPUTHEIGHT).get('value'),","            alignment = this._getAlignmentClass(form.one('.' + CSS.INPUTALIGNMENT).get('value')),","            presentation = form.one('.' + CSS.IMAGEPRESENTATION).get('checked'),","            //constrain = form.one('.' + CSS.INPUTCONSTRAIN).get('checked'),","            imagehtml,","            customstyle = form.one('.' + CSS.INPUTCUSTOMSTYLE).get('value'),","            classlist = [],","            host = this.get('host');","","        e.preventDefault();","","        // Check if there are any accessibility issues.","        if (this._updateWarning()) {","            return;","        }","","        // Focus on the editor in preparation for inserting the image.","        host.focus();","        if (url !== '') {","            if (this._selectedImage) {","                host.setSelection(host.getSelectionFromNode(this._selectedImage));","            } else {","                host.setSelection(this._currentSelection);","            }","","            // if (constrain) {","            //     classlist.push(CSS.RESPONSIVE);","            // }","","            // Add the alignment class for the image.","            classlist.push(alignment);","","            // if (!width.match(REGEX.ISPERCENT) && isNaN(parseInt(width, 10))) {","            //     form.one('.' + CSS.INPUTWIDTH).focus();","            //     return;","            // }","            // if (!height.match(REGEX.ISPERCENT) && isNaN(parseInt(height, 10))) {","            //     form.one('.' + CSS.INPUTHEIGHT).focus();","            //     return;","            // }","","            var template = Y.Handlebars.compile(IMAGETEMPLATE);","            imagehtml = template({","                url: url,","                alt: alt,","                //width: width,","                //height: height,","                presentation: presentation,","                customstyle: customstyle,","                classlist: classlist.join(' ')","            });","","            this.get('host').insertContentAtFocusPoint(imagehtml);","","            this.markUpdated();","        }","","        this.getDialogue({","            focusAfterHide: null","        }).hide();","        ","    },","","    /**","     * Removes any legacy styles added by previous versions of the atto image button.","     *","     * @method _removeLegacyAlignment","     * @param {Y.Node} imageNode","     * @return {Y.Node}","     * @private","     */","    _removeLegacyAlignment: function(imageNode) {","        if (!imageNode.getStyle('margin')) {","            // There is no margin therefore this cannot match any known alignments.","            return imageNode;","        }","","        ALIGNMENTS.some(function(alignment) {","            if (imageNode.getStyle(alignment.name) !== alignment.value) {","                // The name/value do not match. Skip.","                return false;","            }","","            var normalisedNode = Y.Node.create('<div>');","            normalisedNode.setStyle('margin', alignment.margin);","            if (imageNode.getStyle('margin') !== normalisedNode.getStyle('margin')) {","                // The margin does not match.","                return false;","            }","","            imageNode.addClass(this._getAlignmentClass(alignment.value));","            imageNode.setStyle(alignment.name, null);","            imageNode.setStyle('margin', null);","","            return true;","        }, this);","","        return imageNode;","    },","","    _getAlignmentClass: function(alignment) {","        return CSS.ALIGNSETTINGS + '_' + alignment;","    },","","    /**","     * Update the alt text warning live.","     *","     * @method _updateWarning","     * @return {boolean} whether a warning should be displayed.","     * @private","     */","    _updateWarning: function() {","        var form = this._form,","            state = true,","            alt = form.one('.' + CSS.INPUTALT).get('value'),","            presentation = form.one('.' + CSS.IMAGEPRESENTATION).get('checked');","        if (alt === '' && !presentation) {","            form.one('.' + CSS.IMAGEALTWARNING).setStyle('display', 'block');","            form.one('.' + CSS.INPUTALT).setAttribute('aria-invalid', true);","            form.one('.' + CSS.IMAGEPRESENTATION).setAttribute('aria-invalid', true);","            state = true;","        } else {","            form.one('.' + CSS.IMAGEALTWARNING).setStyle('display', 'none');","            form.one('.' + CSS.INPUTALT).setAttribute('aria-invalid', false);","            form.one('.' + CSS.IMAGEPRESENTATION).setAttribute('aria-invalid', false);","            state = false;","        }","        this.getDialogue().centerDialogue();","        return state;","    }","});","","","}, '@VERSION@', {\"requires\": [\"moodle-editor_atto-plugin\"]});","","}());"]};
